CKEDITOR.htmlParser.basicWriter=CKEDITOR.tools.createClass({$:function(){this._={output:[]}},proto:{openTag:function(n){this._.output.push("<",n)},openTagClose:function(n,t){t?this._.output.push(" />"):this._.output.push(">")},attribute:function(n,t){this._.output.push(" ",n,'="',t,'"')},closeTag:function(n){this._.output.push("<\/",n,">")},text:function(n){this._.output.push(n)},comment:function(n){this._.output.push("<!--",n,"-->")},write:function(n){this._.output.push(n)},reset:function(){this._.output=[],this._.indent=!1},getHtml:function(n){var t=this._.output.join("");return n&&this.reset(),t}}});